INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (8, 0, 40000, 91002, "", 100, 36, 0, "", 1, 0);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (8, 0, 40001, 91002, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 150, 37, 107501, "ぺコリーヌ", 1, 1);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (8, 0, 40001, 91002, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 150, 38, 107601, "コッコロ", 2, 1);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (8, 0, 40001, 91002, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 150, 39, 107801, "キャル", 3, 1);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (8, 0, 40001, 91002, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 150, 40, 107701, "スズメ", 4, 1);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (8, 0, 40001, 91002, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 150, 41, 107901, "タマキ", 5, 1);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (8, 0, 40001, 91002, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 150, 42, 107501, "ぺコリーヌ", 6, 2);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (8, 0, 40001, 91002, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 150, 43, 107601, "コッコロ", 7, 2);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (8, 0, 40001, 91002, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 150, 44, 107801, "キャル", 8, 2);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (8, 0, 40001, 91002, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 150, 45, 107701, "スズメ", 9, 2);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (8, 0, 40001, 91002, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 150, 46, 107901, "タマキ", 10, 2);
