INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (2, 0, 40011, 24001, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 321, 125801, "リリ", 1, 1);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (2, 0, 40011, 24001, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1, 322, 126001, "クリア", 2, 1);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (2, 0, 40011, 24001, "んーと。\nこれ、あげる。\nはい", 1, 323, 126101, "プレシア", 3, 1);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (2, 0, 40011, 24001, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 1, 324, 125801, "リリ", 4, 2);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (2, 0, 40011, 24001, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 1, 325, 126001, "クリア", 5, 2);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (2, 0, 40011, 24001, "お兄。\nきてくれて、うれしい", 1, 326, 126101, "プレシア", 6, 2);
